import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
//import city from './city.js';

class Weather extends React.Component {
    render() {
        return(
            <h1>{this.props.city.name}</h1>
        );
    }
}

ReactDOM.render(
    <Weather city={name = 'London'} />,
    document.getElementById("root")
);
